</h1>
<div class="Section6"><br><b>Google Fonts</b>&nbsp;est un service de polices informatiques et de polices web appartenant à Google, incluant des familles de polices gratuites et open source, un répertoire web interactif pour parcourir la bibliothèque et des API pour utiliser les polices via CSS et Android.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
