<h1 class="Section4">
<a class="Section5" href="#" id="utilisation-de-google-fonts-v0-3-8">Utilisation de Google Fonts v0.3.8</a>
</h1>
<div class="Section6"><br>Nous essayerons d'utiliser la police (Akronim) de Google Fonts dans notre environnement de développement. Ouvrir un éditeur de texte selon votre choix (Notepad++). Editer le programme HTML. Editer la feuille de style CSS. Ouvrir la page dans un navigateur selon votre choix (Google Chrome).<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#utilisation-de-google-fonts-v0_ce-qu-il-faut-savoir">Ce qu'il faut savoir</a>
</div>
<div class="GSummary21 Summary4">
